@Shelby sometimes people do things and it isn't about you. Their behavior could be coming from some insecurity they have. I would personally ask. If they don't give you an answer then yeah, I'd just find a new circle of influence. 

As far as losing friends goes I dropped all of my college friends. This last year has been one of the roughest I've had and it was hard not reaching out to them. I knew, however, that I was a better person without them. I didn't like how I was around them. Now I'm happier, I've lost weight, I don't smoke, and I rarely drink. 

Use their absence as a way to explore yourself.

